import React, { Component, Fragment } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import  { Footer, Header } from './Layouts';
import { Tabs, Tab } from '@material-ui/core';
import Home from './SS/Home';
import Sarees from './SS/Sarees';
import Contact from './SS/Contact';

class App extends Component {
  constructor() {
    super();
    this.state = {
      value: 0,
    };
  }

  handleChange = (event, value) => {
    this.setState({ value });
  };

  render() {
    return (
        <Router>
          <Fragment>
          <Header/>
          <Tabs indicatorColor="primary" centered value={this.state.value} onChange={this.handleChange}>
            <Tab label="Home" component={Link} to="/"/>
            <Tab label="Sarees" component={Link} to="/sarees"/>
            <Tab label="Contact us" component={Link} to="/contact-us" />
          </Tabs>
          <Footer/>
          <Route path="/" exact component={Home} />
          <Route path="/sarees" exact component={Sarees} />
          <Route path="/contact-us" exact component={Contact} />
          </Fragment>
        </Router>
    );
  }
}

export default App;
